BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "data_karyawan_mhs" (
	"ID"	varchar(18) NOT NULL,
	"Nama"	varchar(100),
	"Tanggal_Lahir"	date,
	"Usia"	INT(2),
	"Golongan"	varchar(10),
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "pengunjung" (
	"Tanggal"	date,
	"ID"	varchar(18) NOT NULL,
	"Nama"	varchar(100),
	"Tanggal_Lahir"	date,
	"Usia"	INT(2),
	"Golongan"	varchar(10),
	"Diagnosa"	varchar(300),
	"Perawatan_Gigi"	varchar(300),
	"Pengobatan"	varchar(300),
	PRIMARY KEY("ID")
);
COMMIT;
